import axios from "axios";
import React, { useEffect, useState } from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import './Dashboard.css';

export default function Dashboard(){

   const [items,setItems]=useState([]);
   useEffect(()=>{
      getItemData();
   },[])
   const getItemData=async()=>{
      const url='http://localhost:8081/v1/users/items';
      try {
         const itemRes= await axios.get(url); 
        setItems(itemRes.data)
      } catch (error) {
         console.log(error)
      }
    
     
   }
   return(
      <>
                  <section className="bg-transparent">
               <div className="container">
                  {/* <button onClick={() => setshow(true)} class="nav-item nav-link" href="#">Login</button>
                        <button onClick={() => setshow(false)} class="nav-item nav-link" >SignUp</button> */}
                  <Navbar className="bg-transparent">
                     <Container fluid className="bannerHeight">
                        <Navbar.Brand> <img src="/images/Rome-logo.png" alt="" /></Navbar.Brand>
                        <Navbar.Toggle aria-controls="navbarScroll" />
                        <Navbar.Collapse id="navbarScroll">
                           <Nav
                              className="ms-auto "
                              style={{ maxHeight: '100px' }}
                              navbarScroll
                           >
                          
                              

                           </Nav>

                        </Navbar.Collapse>
                     </Container>
                  </Navbar>
               </div>
            </section>
            <section>
               <div className="itemdev row">
                  {items.map((item)=>{
                     return(<>
                     <div className="item col-md-3">
                   
                    <img src={item.itemUrl} alt="" />
                    <h5>{item.itemName}</h5>
                        <p>
                          price : {item.itemPrice} 
                        </p>
                    </div>
                     </>)
                  })}
               </div>
            </section>
      </>
   )

}
